import { Component } from '@angular/core';

@Component({
  selector: 'app-root',
  standalone: true,
  template: `
    <h1>SBTM v2 Test</h1>
    <p>If you can see this, Angular is working!</p>
  `,
  styles: [`
    h1 { color: blue; font-size: 24px; }
    p { color: green; }
  `]
})
export class AppComponent {
  title = 'sbtm-v2-frontend';
}
